import React from 'react';

function Navbar(props) {
  return (
    <div class="flex space-x-10 justify-center">
      <button class="bg-blue-200 px-3">New Proposal</button>
      <button class="bg-blue-200 px-3">View Proposals</button>
      <button class="bg-blue-200 px-3">Edit Proposal</button>
    </div>
  );
}

export default Navbar;
